import React from "react";

const Compose = () => {
  return (
    <div className="compose">
      <div className="compose-header"></div>
      <div className="compose-header-left">
        <span>New Message</span>
      </div>
      <div className="compose-header-right"></div>
      <div className="compose-body"></div>
      <div className="compose-footer"></div>
    </div>
  );
};

export default Compose;
<span>New Message</span>;
